import React from "react";
import { directive } from "@babel/types";

function Book(props) {
  return (
    <div style={{ width: 200, border: "solid" }}>
      <p>title: {props.title}</p>
      <p>author: {props.author}</p>
      <p>page_size: {props.page_size}</p>
    </div>
  );
}

export default Book;
